export const Quizdata = [
  {
    id: 1,
    question: "what does this sign mean?",
    options: ["123,stop,yes,go back"],
    answer: "123"
  },
  {
    id: 2,
    question: "what danger is shown?",
    options: ["dont enter,nothing,all fine"],
    answer: "nothing"
  }
];
